import React, { useEffect } from 'react'
import AddPostForm from '../components/add-post/AddPostForm'
import { connect } from 'react-redux'
import { addProviderPost, getAllProviderPost } from '../redux/actions/providerActions'

function AddPost({ addProviderPost, posts, getAllProviderPost }) {

  useEffect(() => {
    getAllProviderPost();
  }, []);

  return (
    <div>
      <div className="h3 text-white py-2 text-center">{posts.length} posts</div>
      <AddPostForm addProviderPost={addProviderPost} />
    </div>
  )
}

const mapStateToProps = state => {
  console.log(state);
  
  return {
    posts: state.app.posts
  }
}

const mapDispatchToProps = {
  addProviderPost, getAllProviderPost
}


export default connect(mapStateToProps, mapDispatchToProps)(AddPost);
